import React, { Component } from 'react'

import DialogTitle from '@material-ui/core/DialogTitle';
import Dialog from '@material-ui/core/Dialog';
import Fab from '@material-ui/core/Fab'

import CloseIcon from '@material-ui/icons/Close';


class StoreCard extends Component {

  render() {

    return (
      <div>

        <style jsx>
          {`
            .root{
                height:90%;
                width:90%;
            }
          `}
        </style>
        <Dialog 
          aria-labelledby="simple-dialog-title" 
          open={true}
          fullScreen
          maxWidth="xl"
          style={{height:"100%", position:"relative"}}
        >
            <DialogTitle id="simple-dialog-title">
              <Fab size="small" aria-label="menu" onClick={() => this.setState({drawerIsOpen:true})}>
                <CloseIcon />
              </Fab>
              &nbsp;Regresar
            </DialogTitle>
            <div style={{height:'100px', background:'grey'}}></div>
            <div style={{position:"relative"}}>
              <h4>Nombre de la tienda</h4>
              <p>Productos:</p>
              <Fab size="small" aria-label="menu" onClick={() => this.setState({drawerIsOpen:true})} style={{position:"absolute", top:"15px", right:"15px"}}>
                <CloseIcon />
              </Fab>
            </div>
        </Dialog>
      </div>
    )
  }
}

export default StoreCard;
